const fetchJournal = (state = [""], action) => {
  switch (action.type) {
    case "REQUEST_JOURNAL_PENDING":
      return ['{ title: "hello" }'];

    case "REQUEST_JOURNAL_SUCCESS":
      return action.payload;

    // case "REQUEST_JOURNAL_FAILED":
    //   return action.payload;

    default:
      return state;
  }
};

export default fetchJournal;
